import{_ as t,o,c as a,R as r}from"./chunks/framework.E9w9IFh5.js";const _=JSON.parse('{"title":"创建实体","description":"","frontmatter":{"title":"创建实体","date":"2021-05-24T16:30:45.000Z"},"headers":[],"relativePath":"doc/wpdoc/创建实体.md","filePath":"doc/wpdoc/创建实体.md"}'),n={name:"doc/wpdoc/创建实体.md"},l=r('<h1 id="创建实体" tabindex="-1">创建实体 <a class="header-anchor" href="#创建实体" aria-label="Permalink to &quot;创建实体&quot;">​</a></h1><p>实体用于定义数据，在本场景中，我们简单定义一个销售网点的数据，其中包含 <strong>网点名称</strong> ， <strong>网点地址</strong> ，<strong>网点照片</strong> 三个业务字段，同时还包括一个数据主键字段 <strong>id</strong>。</p><h2 id="新增实体" tabindex="-1">新增实体 <a class="header-anchor" href="#新增实体" aria-label="Permalink to &quot;新增实体&quot;">​</a></h2><ol><li>在主导航，切换到实体模块。</li><li>选择一个实体所属的目录。（此处演示可以任意选择，或新增一个）</li><li>点击 <strong>新增</strong> 按钮。</li><li>选择 <strong>原生</strong> 类型的实体。</li></ol><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%88%9B%E5%BB%BA%E5%AE%9E%E4%BD%93.jpg" alt=""></p><h2 id="设置实体信息" tabindex="-1">设置实体信息 <a class="header-anchor" href="#设置实体信息" aria-label="Permalink to &quot;设置实体信息&quot;">​</a></h2><ol><li>选择实体类型：<strong>基本对象</strong></li><li>点击 <strong>下一步</strong> 进入 <strong>基本信息</strong> 填写界面</li><li>填写实体的 <strong>中文名称</strong> 用于识别和后续查找实体</li><li>填写实体的 <strong>英文名称</strong> ，该名称唯一标识该实体，需要全局唯一。</li><li>填写 <strong>表名</strong> ，即实际存储数据的数据库表名称，也需要唯一，通常直接使用 <strong>英文名称</strong> 一样的名字即可</li><li>接下来就可以切换到 <strong>实体属性</strong> 页面，对属性进行设置</li></ol><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%AE%BE%E7%BD%AE%E5%AE%9E%E4%BD%93%E5%B1%9E%E6%80%A7.jpg" alt=""></p><h2 id="设置实体字段属性" tabindex="-1">设置实体字段属性 <a class="header-anchor" href="#设置实体字段属性" aria-label="Permalink to &quot;设置实体字段属性&quot;">​</a></h2><ol><li><p>点击添加按钮新增一个字段。</p></li><li><p>依次填写字段的 <strong>属性名称</strong>，<strong>字段名</strong>，以及 <strong>字段类型</strong>。其中字段名其实就是数据库中的字段名称，需要保证在当前实体中不重复。</p><p>以上步骤总共操作4次，分别添加上此次演示所需要的4个基本属性，填写内容具体如下：</p></li></ol><table><thead><tr><th>属性名称</th><th>字段名</th><th>字段类型</th></tr></thead><tbody><tr><td>id</td><td>id</td><td>主键</td></tr><tr><td>网点名称</td><td>name</td><td>文本</td></tr><tr><td>网点位置</td><td>location</td><td>长文本</td></tr><tr><td>网点照片</td><td>photo</td><td>长文本</td></tr></tbody></table><ol><li>设置完字段属性后，点击保存按钮，就完成了一个实体的新增操作了</li></ol><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E6%B7%BB%E5%8A%A0%E5%AE%9E%E4%BD%93%E5%AD%97%E6%AE%B5.jpg" alt=""></p><h2 id="实体发布" tabindex="-1">实体发布 <a class="header-anchor" href="#实体发布" aria-label="Permalink to &quot;实体发布&quot;">​</a></h2><p>实体在保存后并不会立即生效，需要发布后才会将变动实际生效。</p><ol><li>点击列表中的 <strong>发布</strong> 按钮，即可以一键发布实体了。</li></ol><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%8F%91%E5%B8%83%E5%AE%9E%E4%BD%93.jpg" alt=""></p>',17),s=[l];function i(e,d,p,c,h,g){return o(),a("div",null,s)}const m=t(n,[["render",i]]);export{_ as __pageData,m as default};
